import React, { connect, useEffect } from 'react'
import nextsession from '../../img/next-session.png';
import { actListMovieReducer } from './modules/action';

function ListMovie(props) {

    useEffect(() => {
        props.fetchListMove();
    }, [])

    const renderListMovie = () => {
        if(props.data && props.data.length > 0) {
            return props.data.map()
        }
    }

    return (
        <div className="container listMovie">
            <ul class="nav nav-tabs" id="myTab" role="tablist">
                <li class="nav-item" role="presentation">
                    <a class="nav-link active" id="home-tab" data-toggle="tab" href="#dangChieu" role="tab" aria-controls="home"
                        aria-selected="true">Đang Chiếu</a>
                </li>
                <li class="nav-item" role="presentation">
                    <a class="nav-link" id="profile-tab" data-toggle="tab" href="#sapChieu" role="tab" aria-controls="profile"
                        aria-selected="false">Sắp Chiếu</a>
                </li>
            </ul>
            <div className="tab-content" id="myTabContent">
                <div className="tab-pane fade show active" id="dangChieu" role="tabpanel" aria-labelledby="home-tab">
                    <button className="prev-session"><img src={nextsession} /></button>
                    <button className="forward-session"><img src={nextsession} /></button>
                    <div className="slider__content">
                        <div className="container">
                            <div className="row">
                                {renderListMovie()}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

const mapStateToProps = (state) => {
    return {
        data: state.listMovieReducer.data,
    }
};

const mapDispatchToProps = (dispatch) => {
    return {
        fetchListMove: () => {
            dispatch(actListMovieReducer());
        }
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(ListMovie);
